import innoventLogo from '../assest/image/png/innoventLogo.png';
import profineLogo from '../assest/image/png/profineLogo.png';
import percoLogo from '../assest/image/png/percoLogo.png';
import protekLogo from '../assest/image/png/protekLogo.png';


export const CUSTOMER_REVIEWS = [
    {
        review: 'Компания Tiver Group выполнила отличную работу по разработке промышленных вентиляционных установок и установок дымоудаления. BIM модели готовы к корректной выгрузке в систему «Два Облака». Профессионализм и качество работы Tiver Group впечатляют. Рекомендую!', 
        customer: 'Олег Тимофеев — менеджер отдела маркетинга компании «Инновент»',
    },
    {
        review: 'Команда Tiver  впечатляет своим профессионализмом и качеством разработки BIM семейств. Вариативность и регулируемое количество проходов, типы проходов, крышек у стоек и панелей перед стойками обеспечивают гибкость и удобство использования.', 
        customer: 'Салтанович Антон — директор департамента анализа и планирования компании «PERCo»',
    },
    {
        review: 'Специалисты Tiver Group исполнили обязательства по разработке BIM семейств. Также хочу обратить внимание на качественную коммуникацию, команда всегда на связи! Я смело рекомендую их как надежного партнера для разработки семейств Revit.', 
        customer: 'Грищук Яросла —  главный конструктор компании ООО«ПРОТЭК»',
    },
    {
        review: 'Работа по созданию семейств выполнена с высоким уровнем параметризации. Мы сможем предоставить разработанные модели проектировщикам раздела АР с уверенностью в их точности и функциональности. Браво команде экспертов за их профессионализм и отличную работу!', 
        customer: 'Александр Артюшин — руководитель отдела строительного консалтинга компании «Profine»',
    },
];

